import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; 
import { FaUserEdit } from "react-icons/fa";

const Navbar = () => {
    return (
        <>
        {/* <h1 style={{ textAlign: 'center', marginTop: '20px' }}>Content Creator</h1> */}
        <nav >
            <ul style={{ display: 'flex', justifyContent: 'space-around', listStyleType: 'none', margin: 0, padding: 0 }}>
                <li>
                    <Link to="/" style={{ color: 'whitesmoke', textDecoration: 'none',fontSize:'20px' }}>SearchProfile</Link>
                </li>
                <li>
                    
                    <Link to="/profile" style={{ color: 'whitesmoke', textDecoration: 'none',fontSize:'20px' }}>Profile View</Link>

                </li>
                <li>
                    {/* <Link to="/profile/edit" style={{ color: '#fff', textDecoration: 'none' }}><Faprofileiconedit></Faprofileiconedit></Link> */}
                    <Link to="/profile/edit" style={{ color: 'whitesmoke', textDecoration: 'none',fontSize:"0px", }}>
                   ProfileEdit
    </Link>
                </li>
            </ul>
        </nav>
        </>
    );
};

export default Navbar;
